int main() {
    const int V = 4;

    // Create a graph
    vector<int> adj[V];

    // Add edges
    addEdge(adj, 0, 1);
    addEdge(adj, 0, 2);
    addEdge(adj, 2, 3);
    addEdge(adj, 1, 2);
    
    printGraph(adj, V);

    // Сreate array for edge list
    int** A = new int* [V];

    // Fill edge list according to adjacency list 
    for (int i = 0; i < V; i++)
    {
        A[i] = new int[adj[i].size()];
        int j = 0;
        for (auto x : adj[i])
        {
                A[i][j] = x;
                j++;
        }
    }

    cout << endl << "Edge list: \n";
