function scanFolder(directory)
{
	fs.readdirSync(directory).forEach(function(iter)
	{
		var e = directory+'/'+iter;
		var s = fs.statSync(e);
		if(s.isDirectory())scanFolder(e);
		else if(s.isFile())scanFile(e);
	});
}

