function keyPressed() {
    if(event.keyCode == 87) { // W
        if(yVelocity == 1) {
            return
        }

        xVelocity = 0
        yVelocity = -1
    }
    if(event.keyCode == 83) { // S

        if(yVelocity == -1) {
            return
        }

        xVelocity = 0
        yVelocity = 1
    }
    if(event.keyCode == 65) { // A
        if(xVelocity == 1) {
            return
        }

        xVelocity = -1
        yVelocity = 0
    }
    if(event.keyCode == 68) { // D
        if(xVelocity == -1) {
            return
        }

        xVelocity = 1
        yVelocity = 0
    }

}
function changeSnakePosition() {
    headX += xVelocity
    headY += yVelocity

    

}
function drawApple() {
    context.fillStyle = "red"
    context.fillRect(appleX * tileCount, appleY * tileCount, tileSize, tileSize)
}
function collisionDetection() {
    if(appleX == headX && appleY == headY) {
       appleX = Math.floor(Math.random() * tileCount)
       appleY = Math.floor(Math.random() * tileCount)
    }
}
function isGameOver() {
    let over = false
    if(xVelocity == 0 && yVelocity == 0) {
        return false
    }
    if(headX < 0) {
        over = true
    }
    if(headX >= tileCount) {
        over = true
    }
    if(headY < 0) {
        over = true
    }
    if(headY >= tileCount) {
        over = true
    }
    return over
}
