	static constexpr double phi = 0.6180339887498948482;

	class hash_table {
	public:
		hash_table(uint64_t n) : bucket_size(n) {
			buckets1.resize(bucket_size, { -1, 0 });
		}

		uint64_t hash1(int key) {
			auto temp = key * phi;
			return bucket_size * (temp - static_cast<int>(temp));
		}

		uint64_t hash2(uint64_t key) {
			return (((key << 5) + key * 73) ^ 3297278347) % bucket_size;
		}

		int find(int key);
		void insert(const std::pair<int, int>& key_val);

		std::vector<std::pair<int,int>> buckets1;
	private:
		uint64_t bucket_size;
	};

	int hash_table::find(int key) {
		if (buckets1[hash1(key)].first == key)
			return buckets1[hash1(key)].second;
		if (buckets1[hash2(key)].first == key)
			return buckets1[hash2(key)].second;
		return -1;
	}

	void hash_table::insert(const std::pair<int, int>& key_val)
	{
		auto temp = key_val;

		while (true) {
			uint64_t temp_hash1 = hash1(temp.first);
			uint64_t temp_hash2 = hash2(temp.first);

			if (buckets1[temp_hash1].first == -1 || buckets1[temp_hash1].first == temp.first) {
				buckets1[temp_hash1] = temp;
				return;
			}
			else if (buckets1[temp_hash2].first == -1 || buckets1[temp_hash2].first == temp.first) {
				buckets1[temp_hash2] = temp;
				return;
			}

			std::swap(buckets1[temp_hash1], temp);
		}
	}

	void find_max_min(int first, std::pair<int,int>& max1, std::pair<int, int>& max2, int val) {
		if (first > max1.first || max1.second == 0) {
			max2.first = max1.first;
			max1.first = first;
			max1.second = val;
		}
		else if (first >= max2.first && max1.second != val) {
			max2.first = first;
			max2.second = val;
		}
	}

	std::pair<int,int> my_max(std::pair<int,int> first, std::pair<int, int> second) {
		if (first.second > second.second)
			return first;
		return second;
	}

	int my_min(std::pair<int, int> first, std::pair<int, int> second) {
		if (first.first < second.first)
			return first.second;
		return second.second;
	}

