					maxes[1].first = vec[i].second;
					maxes[1].second = finded_val_y + 1;
				}
			}
		}

		for (int i = 0; i < vec.size(); ++i) {
			auto finded_val_x = hx.find(vec[i].first);
			auto finded_val_y = hy.find(vec[i].second);
			if (finded_val_x != -1) {
				if (finded_val_x + 1 > maxes[2].second && vec[i].first != maxes[0].first) {
					maxes[2].first = vec[i].first;
					maxes[2].second = finded_val_x + 1;
				}
			}
			if (finded_val_y != -1) {
