				flag = i;
			}
		}

		if (flag % 2 == 0)
			check_x.push_back(highest.first);
		else
			check_y.push_back(highest.first);

		flag = 0;

		for (int i = 0; i < 6; ++i) {
			if (maxes[i].second >= middle.second && maxes[i] != highest) {
				middle = maxes[i];
				flag = i;
			}
		}
		
		if (flag % 2 == 0)
			check_x.push_back(middle.first);
		else
			check_y.push_back(middle.first);


		flag = 0;

		for (int i = 0; i < 6; ++i) {
			if (maxes[i].second >= lowest.second && maxes[i] != highest && maxes[i] != middle) {
				lowest = maxes[i];
				flag = i;
			}
		}

		if (flag % 2 == 0)
			check_x.push_back(lowest.first);
		else
			check_y.push_back(lowest.first);
		
		for (int i = 0; i < vec.size(); ++i) {
			bool check_flag1 = true, check_flag2 = true;

