• Да се дополни main методот во кој ќе се иницијализира низа од работници и
 работни недели согласно влезните тест примери. Во првиот ред се чита број на работници, 
 а во секој нареден ред се читаат името и работните недели за секој работник.
На стандарден излез да се испечати низата од работници со помош на методата 
void table(Rabotnik [] niza) која за низата од работници ќе отпечати приказ во 
следниот формат (за простор при печатење се користат три празни места):

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Scanner;

class RabotnaNedela{
	
	private int  casovi [];
	private int brNedela;
	//get i set  metodi za klasa RabotnaNedela
	public int getCasovi() {
		int sum = 0;
		for(int i=0;i<casovi.length;i++)
		{
			sum+=casovi[i];
		}
		return sum;
	}
	public void setCasovi(int[] casovi) {
		this.casovi = casovi;
	}
	public int getBrNedela() {
		return brNedela;
	}
	public void setBrNedela(int brNedela) {
		this.brNedela = brNedela;
	}
	//konstruktor
	public RabotnaNedela(int[] casovi, int brNedela) {
		super();
		this.casovi = casovi;
		this.brNedela = brNedela;
	}
		public String toString() {
		//String out = "";
		String out =new String();
		int sum = 0;
		//for(int cas : casovi)
		for(int i=0;i<casovi.length;i++)
		{
			sum+=casovi[i];
		}
		out += sum;
		return out;
	}
	
}
class Rabotnik{
	
	private String ime;
	private RabotnaNedela [] nedeli;
	public String getIme() {
		return ime;
	}
	public void setIme(String ime) {
		this.ime = ime;
	}
	public RabotnaNedela[] getNedeli() {
		return nedeli;
	}
	public void setNedeli(RabotnaNedela[] nedeli) {
		this.nedeli = nedeli;
	}
	public Rabotnik(String ime, RabotnaNedela[] nedeli) {
		super();
		this.ime = ime;
		this.nedeli = nedeli;
	}
	@Override
	public String toString() {
		String out =  ime + "   ";
		int vk = 0;
		for(int i=0;i<nedeli.length;i++)
		{
			vk+=nedeli[i].getCasovi();
			out+=nedeli[i]+"   ";
			//out+=nedeli[i].toString()+"   ";
		}
		out+=vk+"\n";
		return out;
	}
	public int sumNedeli()
	{
		int vk = 0;
		//for(RabotnaNedela ned: nedeli)
		for(int i=0;i<nedeli.length;i++)
		{
			vk+=nedeli[i].getCasovi();
		}
		return vk;
	}
	
}

public class Main {	
	
	public static Rabotnik najvreden_rabotnik(Rabotnik [] niza)
	{
		Rabotnik najvreden = niza[0];
		for(Rabotnik r: niza)
		for(int i=0;i<niza.length;i++)	
		{
			if(r.sumNedeli()>najvreden.sumNedeli())
			{
				najvreden = r;
			}
		}
		return najvreden;
	}
	public static void table(Rabotnik [] niza)
	{   
		String out = "Rab   1   2   3   4   Vkupno\n";
		for(Rabotnik r: niza)
		{
			out+=r;
		}
		System.out.println(out);
		
	}

	public static void main(String[] args) {

		int n;
		Scanner input = new Scanner(System.in);
		n = input.nextInt();
	    input.nextLine();
		Rabotnik [] niza = new Rabotnik[n];
		for(int i=0;i<n;i++)
		{    //input.next!=input.nextLine
			String name = input.next();
			List<RabotnaNedela> nedeli = new ArrayList<RabotnaNedela>();

			for(int z = 0;z<4;z++)
			{
				int [] casovi = new int[5];
				casovi[0] = input.nextInt();
				casovi[1] = input.nextInt();
				casovi[2] = input.nextInt();
				casovi[3] = input.nextInt();
				casovi[4] = input.nextInt();
				RabotnaNedela ned = new RabotnaNedela(casovi,z+1);
				nedeli.add(ned); //na nedeli se dodave i ned
			}
			niza[i] = new Rabotnik(name, nedeli.toArray(new RabotnaNedela[nedeli.size()]));
		}

		table(niza);
		System.out.println("NAJVREDEN RABOTNIK: " +najvreden_rabotnik(niza).getIme());
		
	}
}
